import React,{useEffect} from "react";

import "./Map.css";

const Map = (props) => {

  useEffect  

  const map = new window.google.maps.Map(document.getElementById("map-render"),{
    center: props.center,
    zoom: props.zoom
  });

  new window.google.map.Marker({position:props.center,map:map});

  return (
    <div
      id="map-render"
      className={`map ${props.className}`}
      style={props.style}
    ></div>
  );
};

export default Map;
